Day 29, Still In.

&#x200B;

The penultimate day of NNN. We lay so close to our goal, I can feel the breath of December on my neck. It's times like these I reflect on what I've done, the compromises I've made, and the promises I've kept. When I started, I was fully intending to not look at any material, but that was a goal I couldn't reach. It may be a problem, or it may be my rampant curiosity of what new things have been made. Any cropped image used as a thumbnail for sub-par meme videos, every new post of certain artists must be seen. It's not for the booba, at least I don't think. I see what I came for, and then leave. It's not the prize I'm after, I just *have* to see what's behind door #2. Maybe next year I can refrain long enough. At least then I'll have plenty of new material for the Big Nut. Best of luck on the last 2 days.

It's honestly been such a journey. Proud of myself for going this long without making the bald eagle cry.

&#x200B;

I will miss you Cumrades!

